import React from 'react';
import { CardImg, Col, Card, CardBody, CardTitle, CardSubtitle, CardText, Button } from 'reactstrap';
import './Producto.css';

function Producto(props){
    return(
        <Col sm="4">
            <Card className="Card">
                <CardImg src="https://image.freepik.com/vector-gratis/afeitadora-electrica-recargable-realista-poster-publicitario-motor-velocidad-plantilla-azul-degradado_1284-28304.jpg"/>
                <CardBody>
                    <CardTitle>{props.titulo}</CardTitle>
                    <CardSubtitle>Color: "Azul / Negro"</CardSubtitle>
                    <CardText>
                        Afeitadora color nose qe le gusta el flow mamai ajaj
                        </CardText>                   
                    <Button className="Button">Comprar</Button>
                    <Button className="Button">Ver Ficha</Button>
                </CardBody>
            </Card>
        </Col>
    );
}

export default Producto;
